import React from "react";

function Contact() {
  return (
    <>
      <div className="contact">
        <div className="contactTitle">
          <h1>
            <b>Contact Us</b>
          </h1>

        </div>
        <div className="contactInfo">
          <h3>Washington D.C</h3>
          <h4>United States</h4>
          <h4>+41 009 567 3211</h4>
          <h4>offlimits@library.com</h4>
        </div>
        <h5 className="rights"><b>OffLimits</b> Library</h5>
      </div>
    </>
  );
}

export default Contact;
